import React, { Component } from 'react'
import PropTypes from 'prop-types'

export default class Dashboard extends Component {
    static propTypes = {
        prop: PropTypes
    }

    render() {
        return (
            <div>
                <h1><i class="far fa-edit"></i>Welocme to Dashboad</h1>
            </div>
        )
    }
}
